import React, {useState} from 'react'
import { useEffect } from 'react/cjs/react.production.min';

export default function GetTest(props) {
    const[task, setTask] = useState(updateTask(props.name));
    useEffect(() => {
        setTask(updateTask(props.name));
    });
    function updateTask() {
        fetch('https://mypew.ru/php/table.php', {
            method: 'POST',
            header: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({
                table : 3,
                date : props.name,
                day_count: 1,
            })
        })
        .then (res => res.json())
        .then ((response) => {
            console.log(response);
            return (response)
        })
      }
  return (
    <div>{props.name}{task}</div>
  )
}
